INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Rerum iste recusandae maiores tempora.', 'Sed maxime sint rerum. Maxime magnam saepe sit quod et est voluptate. Qui neque ut perferendis rerum labore ea. Quod est eum consequatur sed explicabo omnis.', 'Cupiditate nihil et rerum molestias et cum natus. Et ipsum hic quasi sunt. Dicta quis aut aliquid.', '1979-10-10');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Minima omnis odit inventore fuga.', 'Recusandae enim culpa molestias qui commodi molestiae aut. Excepturi nesciunt modi molestiae molestias voluptate adipisci. Commodi est maxime voluptatem non suscipit enim sed natus.', 'Totam velit rerum itaque minus omnis. Eveniet distinctio nulla magnam repellat. Dicta est inventore non molestiae dolorem maxime. Quisquam debitis nihil alias est est et.', '2002-01-06');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Voluptas nulla libero iste quas omnis.', 'Qui sequi dolores in eaque sit. Deleniti autem perferendis et deleniti voluptates. Repellat provident vel sapiente omnis cum cum corporis. Inventore animi aliquam nostrum voluptas vel accusantium aut nobis.', 'Itaque voluptatibus eos nesciunt autem velit veritatis sint minima. Vero consequatur esse earum modi possimus inventore.', '2019-04-06');
